import React from 'react';
import style from '../styles/welcome.module.css'

const Welcome = () => {
    return (
        <div className={style.container} >
            <h1>Hola! Soy Zoe</h1>
            <h1></h1>
            <img src={process.env.PUBLIC_URL + '/flowers.png'}></img>
        </div>
    );
};

export default Welcome;
